-- 1. Вывести модели смартфонов без повторений брендов Xiaomi, HONOR, HUAWEI с ценой от 15_000 до 25_000.


select distinct model from product_skr
join vendor_product_info_vlz p on p.product_id = id
where brand in ('Xiaomi', 'Honor', 'Huawei') and p.price >= 15000 and p.price <= 20000;

-- 2. Вывести названия компаний (НЕ брендов), поставляющих смартфоны как с ОС Android, так и с ОС iOS.
select name from vendor_qwy
join vendor_product_info_vlz pp on pp.vendor_qwy.id = id 
join product_skr on product_skr.id = pp.product.id
where product_skr.os = 'Android';
intersect
select name from vendor_qwy
join vendor_product_info_vlz pp on pp.vendor_qwy.id = id 
join product_skr on product_skr.id = pp.product.id
where product_skr.os = 'iOS';


-- 3. Вывести названия компаний, поставляющие часы, но не смартфоны.

select name from vendor_qwy
join vendor_product_info_vlz pp on pp.vendor_qwy.id = id 
join product_skr on product_skr.id = pp.product.id
where category = 'часы'
except
select name from vendor_qwy
join vendor_product_info_vlz pp on pp.vendor_qwy.id = id 
join product_skr on product_skr.id = pp.product.id
where category = 'смартфоны';
-- 4. Вывести названия компаний, поставляющих ноутбуки и мониторы либо имеющие транспортные средства с объемом(body_volume) от 30 и грузоподъемностью от 20.4

select name from vendor_qwy
join vendor_product_info_vlz pp on pp.vendor_qwy.id = id 
join product_skr on product_skr.id = pp.product.id
where product_skr.type = 'ноутбуки' or product_skr.type = 'мониторы'
union
select name from vendor_qwy
join vendor_product_info_vlz pp on pp.vendor_qwy.id = id 
join product_skr on product_skr.id = pp.product.id
where product_skr.body_volume >= 30 and product_skr.lifting_capacity >= 20;
-- 5. Вывести минимальную и максимальную цену, средний размер экрана и суммарную стоимость (price * quantity) электронных книг бренда Amazon.
select max(price), min(price), avg(screen size), sum(price * quantity)
from vendor_product_info_vlz pp
join product_skr po on po.id = pp.product.id
where po.brand = 'Amazon' and po.category = 'электронные книги';

-- 6. Вывести модели электронных книг с наименьшим весом и наименьшей ценой среди электронных книг с наименьшим весом.
with models_min_size as (with models_min_price as(
    select model, weight, price from product_skr po
    where po.category = 'электронные книги'))
    select * from models_min_price
    where weight = (select min(price) from models_min_size);

-- 7. Вывести количество различных брендов в категории электронные книги.

with brands as (select distinct brand from product_skr po)
select count(brand) from brands
where category = 'электрронные книги';






create extension if not exists "uuid-ossp";

drop table if exists vendor_qwy, product_skr, vendor_product_info_vlz, transport_q6r, vendor_transport_info_fwj cascade;

create table vendor_qwy
(
    id      uuid primary key,
    name    text,
    phone   text
);

create table product_skr
(
    id              uuid primary key,
    model           text,
    category        text,
    brand           text,
    score           numeric,
    screen_material text,
    screen_size     int,
    height          int,
    width           int,
    weight          int,
    sales_start     int,
    sales_end       int,
    os              text,
    color           text
);

create table vendor_product_info_vlz
(
    vendor_id uuid references vendor_qwy,
    product_id uuid references product_skr,
    price numeric,
    quantity int,
    primary key (product_id, vendor_id)
);

create table transport_q6r
(
    id                uuid primary key,
    model             text,
    body_volume       int,
    lifting_capacity  int
);

create table vendor_transport_info_fwj
(
    vendor_id uuid references vendor_qwy,
    transport_id uuid references transport_q6r,
    quantity int,
    primary key (transport_id, vendor_id)
);





